export class WSrun {
    constructor(debug: boolean): WSrun
    /**是否为debug模式 */
    debug?: Boolean;
    /**是否为WS RLrun交互模式 */
    isCmd?: Boolean;
    /**读取到的代码 */
    getCode?: String;
    /**在WS RLrun交互模式时储蓄的变量 */
    allVar?: Object;
    /**将运行文件路径设置为 `path` */
    setPath(path: string): WSrun;
    /**将运行代码设置为 `code` */
    setCode(code: string): WSrun;
    /**将模式设为WS RLrun交互模式  
     * 将运行代码设置为 `code` */
    setCmd(code: string): WSrun;
    /**运行 文件 或 读取到的代码 */
    run(): WSrun;
}